import React, { Component } from 'react'

export class Dashboard extends Component {
    constructor(){
        super()
        var pp = 0;
        this.pp = parseInt(localStorage.getItem('profile_pic_exists'));
    }


    render() {
        return (
            <div>
                { pp }
            </div>
        )
    }
}

export default Dashboard
